import React, { Component } from "react";
import {
  Button,
  Input,
  Container,
  Grid,
  AppBar,
  Toolbar,
  TextField,
  CardMedia
} from "@material-ui/core";

class Header extends Component {
  state = {
    textInput: ""
  };

  inputHandle = event => {
    if (event.target.value) {
      this.setState({ textInput: event.target.value });
    } else {
      this.setState({ textInput: "" });
    }
  };

  render() {
    return (
      <div>
        <AppBar position="static" color="primary">
          <Grid color="primary">
            <Toolbar>
              <CardMedia
                image={require("../images/6pm-Logo-1x._V285053994_.png")}
              />
              <Button onClick={() => console.log("OK")}>Home</Button>
              <Button>Contact</Button>
              <Button>About</Button>
              <Button>Login</Button>
              <Button>Register</Button>
            </Toolbar>
          </Grid>
        </AppBar>
        <Container>
          <Button
            variant="contained"
            color="primary"
            onClick={() => console.log(this.state.textInput)}
          >
            Hello World
          </Button>
          <br />
          <TextField onChange={this.inputHandle} />
        </Container>
      </div>
    );
  }
}

export default Header;
